import React from 'react';
import { Button } from 'semantic-ui-react';


const NavBar = (props) => {
  const { history,currentUser,logout, signUp } = props;
  return (
    <div>
      <Button color='red' onClick={() => history.push('/search')}>
        Search
      </Button>
      {currentUser && (
        <Button as='icon' color='red' onClick={() => history.push('/profile')}>
          Profile
        </Button>
      )}
      {currentUser && (
        <Button color='red' onClick={logout}>
          Logout
        </Button>
      )}

    </div>
  );
};
export default NavBar;
